import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

import Rating from '@material-ui/lab/Rating';
import Title from '../common/Title';
import Paper from '@material-ui/core/Paper';


// Generate Order Data
function createData(element, level, explain) {
       return { element, level, explain };
}

// Rateのオブジェクトを返す関数
const levelDef = (level) => {
       return (
              <Rating name="read-only" value={level} max={3} readOnly />
       )
}


const frontRows = [
       createData("HTML", levelDef(2), "基本的なタグの意味を理解し、webページを実装できる。"),
       createData("CSS", levelDef(2), "基本的なタグの意味は理解、webページを実装できる"),
       createData("JavaScript", levelDef(2), "基本的な使い方は理解し、動的なwebページを実装できる"),
       createData("React", levelDef(2), "基本的な使い方を理解し、CRUDアプリケーションを構築できる。(当サイトもReactを利用)"),
       createData("Materil UI", levelDef(2), "基本的な使い方を理解し、Webサイトを構築できる。(当サイトもMaterilal UIを利用)"),
       createData("Thymeleaf", levelDef(3), "業務で利用経験があり、他者のコードをRvできるレベルである。"),
];

const backRows = [
       createData("Java", levelDef(2), "Java言語を利用してアプリケーションを構築でき、他者のコードRvを実施できる"),
       createData("", levelDef(3), "適切なSQL文の作成からチューニングまで実施できる"),
       createData("Java", levelDef(3), "独学で実装することができる"),
       createData("Java", 3, "独学で実装することができる"),
       createData("Java", 3, "独学で実装することができる"),
       createData("Java", 3, "独学で実装することができる"),

];



const useStyles = makeStyles((theme) => ({
       seeMore: {
              marginTop: theme.spacing(3),
       },
       paper: {
              padding: theme.spacing(2),
              display: 'flex',
              overflow: 'auto',
              flexDirection: 'column',
       },
}));

function preventDefault(event) {
       event.preventDefault();
}

export default function Skills() {
       const classes = useStyles();
       return (
              <>
                     <Paper className={classes.paper}>
                            <Title>フロントエンド</Title>
                            <Table size="small">
                                   <TableHead>
                                          <TableRow>
                                                 <TableCell>技術要素</TableCell>
                                                 <TableCell>レベル</TableCell>
                                                 <TableCell>説明</TableCell>
                                                 {/* <TableCell align="right">Sa？le Amount</TableCell> */}
                                          </TableRow>
                                   </TableHead>
                                   <TableBody>
                                          {frontRows.map((row) => (
                                                 <TableRow key={row.element}>
                                                        <TableCell>{row.element}</TableCell>
                                                        <TableCell>{row.level}</TableCell>
                                                        <TableCell>{row.explain}</TableCell>
                                                        <TableCell>{row.paymentMethod}</TableCell>
                                                        <TableCell align="right">{row.amount}</TableCell>
                                                 </TableRow>
                                          ))}
                                   </TableBody>
                            </Table>
                     </Paper>


                     <Paper className={classes.paper}>
                            <Title>バックエンド</Title>
                            <Table size="small">
                                   <TableHead>
                                          <TableRow>
                                                 <TableCell>技術要素</TableCell>
                                                 <TableCell>レベル</TableCell>
                                                 <TableCell>説明</TableCell>
                                                 {/* <TableCell align="right">Sa？le Amount</TableCell> */}
                                          </TableRow>
                                   </TableHead>
                                   <TableBody>
                                          {backRows.map((row) => (
                                                 <TableRow key={row.element}>
                                                        <TableCell>{row.element}</TableCell>
                                                        <TableCell>{row.level}</TableCell>
                                                        <TableCell>{row.explain}</TableCell>
                                                        <TableCell>{row.paymentMethod}</TableCell>
                                                        <TableCell align="right">{row.amount}</TableCell>
                                                 </TableRow>
                                          ))}
                                   </TableBody>
                            </Table>
                     </Paper>
              </>
       )
}
